import React from 'react';
import headerLogo from '../images/header_logo.svg';

function Header(props) {
  function handleDisplay() {
    if(props.isLoggedIn) {
      return <button onClick={props.handleSignout} className="header__button">Log out</button>
    } else if(!props.isLoggedIn && props.path === 'signin') {
      return <a href='/signup' className="header__link">Sign up</a>
    } else {
      return <a href='/signin' className="header__link">Log in</a>
    }
  }
  return(
    <header className="header">
      <img src={headerLogo} alt="header-logo" className="logo" />
      <div>
        {props.isLoggedIn ? <p className="header__paragraph">{props.email}</p> : ''}
        {handleDisplay()}
      </div>
    </header>
  )
}

export default Header;
